// Obtener mensaje y sessionId
const mensaje = $input.first().json.consulta_usuario;
const sessionId = $input.first().json.session_id;

// Patrones para detectar URLs de propiedades
const urlPatterns = [
  'zonaprop.com',
  'argenprop.com',
  'inmuebles24.com',
  'mercadolibre.com.ar',
  'properati.com.ar',
  'buscadorprop.com.ar',
  'arrendamientossantafe.com'
];

// Extraer URL del mensaje (si existe)
let urlLimpia = '';
let esUrlPropiedad = false;

// Expresión regular para encontrar URLs en el texto
const urlRegex = /(https?:\/\/[^\s,]+)/g;
const matches = mensaje.match(urlRegex);

if (matches && matches.length > 0) {
  urlLimpia = matches[0]; // Tomar la primera URL encontrada

  // Verificar si la URL es de una propiedad
  esUrlPropiedad = urlPatterns.some(pattern => urlLimpia.includes(pattern));
}

// Retornar resultado con la URL limpia
return {
  session_id: sessionId,
  mensaje_usuario: esUrlPropiedad ? urlLimpia : mensaje, // Si es URL, usar la URL limpia, sino el mensaje original
  es_url_propiedad: esUrlPropiedad
};

// Obtener los datos relevantes
const sessionId = $('URL datos').first().json.numero_telefono;
const urlMsg =$('Determinar Tipo de Mensaje').first().json.mensaje_usuario ;
const contadorKey = 'propiedades:' + sessionId + ':contador';
const contador = $input.first().json.getContador;

// Crear y retornar un objeto con toda la información necesaria
return {
  session_id: sessionId,
  contador: contador,
  url_mensaje: urlMsg,
  contador_key: contadorKey,
  url_key: 'propiedades:' + sessionId + ':url:' + contador,
  url_activa_key: 'propiedades:' + sessionId + ':url_activa'
};

// Obtener datos de la sesión
const telefono =$('URL datos').first().json.numero_telefono ;

// Este nodo prepara los datos necesarios para obtener la URL activa
return {
  celular: telefono,
  url_activa_key: 'propiedades:' + telefono + ':url_activa'
};

// Obtener datos de entrada
const sessionId = $('Preparar Consulta URL').first().json.celular;
const contadorActivo = $('Añadir a Lista URLs').first().json.contador;

// Crear la clave para obtener la URL
return {
  telefono: sessionId,
  contador_activo: contadorActivo,
  url_key: 'propiedades:' + sessionId + ':url:' + contadorActivo
};

// Este nodo hace de puente entre la gestión de URLs y el análisis
const sessionId = $('URL datos').first().json.numero_telefono;
const urlPropiedad =$input.first().json.ID ; // La URL obtenida del nodo anterior

// Validar que tengamos una URL para procesar
if (!urlPropiedad || urlPropiedad === null) {
  console.log('Error: No se pudo obtener una URL válida para analizar');
  return {
    error: true,
    message: 'No se pudo obtener una URL válida para analizar',
    session_id: sessionId
  };
}

return {
  ID: urlPropiedad, // Esta será la URL que se enviará a HTTP Request
  session_id: sessionId,
  error: false
};

// Get the Propiedad array from the input
const propiedadArray = $input.first().json.Propiedad;

// Check if it's an array and has elements
if (Array.isArray(propiedadArray) && propiedadArray.length > 0) {
  // Get the last element using array indexing
  const lastElement = propiedadArray[propiedadArray.length - 1];

  // Return an object with both the original array and the last element
  return {
    Propiedades: propiedadArray,
    Ultima_propiedad: lastElement
  };
} else {
  // Handle the case where Propiedad is not an array or is empty
  return {
    Propiedades: propiedadArray,
    Ultima_propiedad: "No array elements found"
  };
}

// 1. Obtener el mensaje de usuario que contiene la URL
const mensaje = $('Determinar Tipo de Mensaje').first().json.mensaje_usuario || "";

// 2. Obtener la lista de URLs almacenadas
const urlsLista = $input.first().json.urls_lista || [];

// Asegurarse de que urlsLista sea un array
let listaFinal = urlsLista;
if (!Array.isArray(urlsLista)) {
  if (typeof urlsLista === "string") {
    try {
      listaFinal = JSON.parse(urlsLista);
    } catch (e) {
      listaFinal = [urlsLista];
    }
  } else {
    listaFinal = [];
  }
}

// 3. Verificar si el mensaje coincide con alguna URL en la lista (COMPARACIÓN EXACTA)
let hayCoincidencia = false;
let urlComparacion = null;

// Recorrer toda la lista de URLs y comparar directamente
for (const url of listaFinal) {
  // Comparación directa, sin normalización
  if (mensaje === url) {
    hayCoincidencia = true;
    urlComparacion = url;
    console.log("¡URL duplicada encontrada!");
    break;
  }
}

// 4. Preparar arrays de URLs nuevas y existentes
const nuevasUrls = [];
const urlsExistentes = [];

if (hayCoincidencia) {
  // Si la URL ya existe, agregarla a existentes
  urlsExistentes.push(mensaje);
} else if (mensaje) {
  // Si la URL no existe y no está vacía, agregarla a nuevas
  nuevasUrls.push(mensaje);
  // Y también agregarla a la lista de URLs
  listaFinal.push(mensaje);
}

// 5. Identificar la URL activa
// Si hay coincidencia, usar la URL que coincidió
// Si no, usar el mensaje o la última URL de la lista
const urlActiva = urlComparacion || mensaje || 
  (listaFinal.length > 0 ? listaFinal[listaFinal.length - 1] : null);

// 6. Si tenemos más de 20 URLs, mantener solo las 20 más recientes
if (listaFinal.length > 20) {
  listaFinal = listaFinal.slice(-20);
}

// 7. Asegurarse de que la URL activa siga estando en la lista
if (urlActiva && !listaFinal.includes(urlActiva)) {
  listaFinal.unshift(urlActiva);
  if (listaFinal.length > 20) {
    listaFinal.pop();
  }
}

// 8. Preparar el resultado
return {
  json: {
    urls_lista: listaFinal,
    nuevas_urls: nuevasUrls,
    urls_existentes: urlsExistentes,
    hay_urls_duplicadas: hayCoincidencia,
    url_activa: urlActiva,
    url_comparacion: urlComparacion
  }
};

// Procesar el resultado del análisis
const sessionId =$('Respuesta Código No en DB').first().json.ID ;
const codigo = $('Respuesta Código No en DB').first().json.codigo_propiedad;
const analisisTexto = $('Respuesta Código No en DB').first().json.response ;
const url= $('Preparar Datos para HTTP').first().json.ID

// Preparar datos para guardar en Redis
return {
  url_activa: url,
  telefono: sessionId,
  codigo_propiedad: codigo,
  analisis: analisisTexto,
  timestamp: Date.now(),
  redis_key: `propiedades:analisis:${codigo}`
};

function extraerCodigos() {
  try {
    const datosEntrada = $input.first().json || {};
    const scrapingRaw = $('Scraping Bee').first().json.data || "";

    const caracteristicasExtra = datosEntrada['Caracteristicas extra'] || "";
    let codigoAnunciante = "";
    let codigoZonaprop = "";

    // === 1. Buscar en Características extra ===
   const regexZonaprop = /Cód\.\s*del\s*anunciante:?\s*([\w.]+).*?Cód\.\s*Zonaprop:?\s*(\d+)/is;
    const matchZonaprop = caracteristicasExtra.match(regexZonaprop);

    if (matchZonaprop) {
      codigoAnunciante = matchZonaprop[1];
      codigoZonaprop = matchZonaprop[2];
    } else {
      const regexArgenprop = /Código\s+de\s+aviso:\s*([\w-]+)/i;
      const matchArgenprop = caracteristicasExtra.match(regexArgenprop);
      if (matchArgenprop) {
        codigoAnunciante = matchArgenprop[1];
      }
    }

    // === 2. Si no se encontró, buscar en el HTML scrapeado ===
    if (!codigoAnunciante) {
      const regexScraped = /Código\s+de\s+aviso:\s*([\w-]+)/i;
      const matchScraped = scrapingRaw.match(regexScraped);
      if (matchScraped) {
        codigoAnunciante = matchScraped[1];
      }
    }

    // === 3. Si aún no se encontró, intentar limpiar input directo ===
    if (!codigoAnunciante && datosEntrada.Codigo) {
      const matchLimpio = String(datosEntrada.Codigo).match(/([\w-]{6,})/);
      if (matchLimpio) {
        codigoAnunciante = matchLimpio[1];
      }
    }

    // === 4. Intento general para cod numérico ===
    if (!codigoZonaprop) {
      const regexNumerico = /\b(\d{7,9})\b/;
      const matchNumerico = caracteristicasExtra.match(regexNumerico) || scrapingRaw.match(regexNumerico);
      if (matchNumerico) {
        codigoZonaprop = matchNumerico[1];
      }
    }

    // === 5. Construcción final ===
    const resultado = { ...datosEntrada };
    resultado.Codigo = codigoAnunciante || "No se encontró el código del anunciante";
    resultado.CodigoZonaprop = codigoZonaprop || "No se encontró el código Zonaprop";
    resultado.PostingCode = codigoAnunciante || codigoZonaprop || "No se encontró el posting code";

    return [resultado];

  } catch (error) {
    console.error("Error al procesar datos:", error);
    return [{
      ...($input.first().json || {}),
      Codigo: "Error al procesar datos",
      CodigoZonaprop: "Error al procesar datos",
      PostingCode: "Error al procesar datos",
      Error: error.toString()
    }];
  }
}

return extraerCodigos();

